# -------------->> solution : sliding window algorithmn

class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        best = 0
        count = 0 
        for i,x in enumerate(s):
            if x in "aeiou":
                count = count +1
            if i>=k and s[i-k] in "aeiou":
                count = count -1
            best = max(best,count)      
        return best

